import { Container, Row } from "react-bootstrap";

const MyFooter = () => {
  return (
    <>
      <Container>
        <Row>
          <Col>
            <div className="footer bg-black text-white mt-5  ">
              <p className="text-center">Copyright &copy; 2022</p>
            </div>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default MyFooter;
